from  typing import List
"""
1007. Minimum Domino Rotations For Equal Row
Medium

In a row of dominoes, tops[i] and bottoms[i] represent the top and bottom halves of the ith domino. 
(A domino is a tile with two numbers from 1 to 6 - one on each half of the tile.)

We may rotate the ith domino, so that tops[i] and bottoms[i] swap values.

Return the minimum number of rotations so that all the values in tops are the same, or all the values 
in bottoms are the same.

If it cannot be done, return -1
"""
class Solution:
    def minDominoRotations(self, tops: List[int], bottoms: List[int]) -> int:
        """
        O(N) time
        O(1) space
        :param tops:
        :param bottoms:
        :return:
        """

        def min_rotation(val):

            top = bottom = 0
            for i in range(len(tops)):
                if tops[i] != val and bottoms[i] != val:
                    return -1
                elif tops[i] != val:
                    top+=1
                elif bottoms[i] != val:
                    bottom+=1
            return min(top,bottom)

        rotations = min_rotation(tops[0])

        if rotations != -1 or tops[0]==bottoms[0]:
            return rotations
        else:
            return min_rotation(bottoms[0])

s = Solution()

